    public class RepeatedSubstring459 {
        public static boolean repeatedSubstringPattern(String s) {
            if (s.length()<=1) return false;

            Map<String,Integer> sortedMAP= new TreeMap<String,Integer>();
            String[] cont= new String[1000000];
            int counter=0;

            for (int ii = 0; ii <s.length() ; ii++) {
                for (int j = ii+1; j <= s.length(); j++) {


//                if (s.substring(ii, j).length()>=2) {
                    if ((s.length()%s.substring(ii, j).length()==0)&&(s.length()!=s.substring(ii, j).length())) {
                        cont[counter++]=s.substring(ii, j);
                    }

                }
            }


            while (counter>0) {
                for (int j = 0; j <s.length() ; j+=cont[counter].length()) {
                    if (!s.substring(j,j+cont[counter].length()).equals(cont[counter])) break;
                    if ((j==s.length()-cont[counter].length())&&(s.substring(j,j+cont[counter].length()).equals(cont[counter])) ) return true;
                }
                counter--;
            }



            return false;

        }
    public static void main(String[] args) {
//        String s="abab";
        String s ="";
        System.out.println(repeatedSubstringPattern(s));
    }
}
